import React from 'react';

const Navigation = () => {
  return (
    // <nav>
    //   <a href="#">Home</a>
    //   <a href="#">Products</a>
    //   <a href="#">About Us</a>
    //   <a href="#">Contact Us</a>
    // </nav>
    <nav>
    <div className="logo">
      <img src="https://via.placeholder.com/50" alt="ABC Pharmacy Logo" />
      <span>ABC Pharmacy</span>
    </div>
    <a href="#">Home</a>
    <a href="#">Products</a>
    <a href="#">About Us</a>
    <a href="#">Contact Us</a>
  </nav>
  );
}

export default Navigation;
